import React, { useState } from 'react';
import './adminnav.css';
import { Link, useNavigate } from 'react-router-dom';

const AdminNavBar = () => {
  const navigate = useNavigate();
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  // Retrieve the logged-in user
  const user = JSON.parse(localStorage.getItem('currentUser'));

  // Handle logout functionality
  const handleLogout = () => {
    localStorage.removeItem('currentUser'); // Clear the logged-in user data from localStorage
    navigate('/'); // Redirect to the home page
  };

  // Toggle dropdown visibility
  const toggleDropdown = () => {
    setIsDropdownOpen((prev) => !prev);
  };

  return (
    <div className='main'>
      <div id="nav-bar">
        <input id="nav-toggle" type="checkbox" />
        <div id="nav-header">
          <a
            id="nav-title"
            href="https://www.vellaglobal.com/"
            target="_blank"
            rel="noopener noreferrer"
          >
            Admin
          </a>
          <label htmlFor="nav-toggle" style={{ marginRight: '30px' }}>
            <span id="nav-toggle-burger"></span>
          </label>
          <hr />
        </div>
        <div id="nav-content">
          <div className="nav-button">
            <i className="fas fa-palette"></i>
            <Link to="/AdminDashboardPage" className="nav-link">
              Dashboard
            </Link>
          </div>
          <div className="nav-button">
            <i className="fas fa-calendar-days"></i>
            <Link to="/UsersRole" className="nav-link">
              Add Users Role
            </Link>
          </div>
          <div className="nav-button">
            <i className="fas fa-gear"></i>
            <a href="AssetRegistration" className="nav-link">
              Asset Registration
            </a>
          </div>
          <hr />
          <div className="nav-button">
            <i className="fas fa-user"></i>
            <a href="/Users" className="nav-link">
              Users
            </a>
          </div>
          <div id="nav-content-highlight"></div>
        </div>
        <input id="nav-footer-toggle" type="checkbox" />
        <div id="nav-footer">
          <div id="nav-footer-heading">
            <div id="nav-footer-avatar">
              <img
                src="https://gravatar.com/avatar/4474ca42d303761c2901fa819c4f2547"
                alt="Avatar"
              />
            </div>
            <div id="nav-footer-titlebox">
              {user ? (
                <>
                  <h5
                    style={{ fontSize: '18px', color: 'white', cursor: 'pointer' }}
                    onClick={toggleDropdown}
                  >
                    {user.username}
                  </h5><i className="fas fa-calendar-days"><button
                        onClick={handleLogout}
                        style={{
                          /*padding: '5px 10px',*/
                          fontSize: '16px',
                          backgroundColor: '#ff5c5c',
                          color: 'white',
                          border: 'none',
                          borderRadius: '5px',
                          cursor: 'pointer',
                          width: '100%',
                        }}
                      >
                        Logout
                      </button></i>
                  {isDropdownOpen && (
                    <div
                      style={{
                        position: 'absolute',
                        backgroundColor: '#333',
                        color: 'white',
                        padding: '0px',
                        borderRadius: '5px',
                        
                        right: '0px',
                        zIndex: 10,
                        marginBottom:'2000px'
                      }}
                    >
                      <button
                        onClick={handleLogout}
                        style={{
                          /*padding: '5px 10px',*/
                          fontSize: '16px',
                          backgroundColor: '#ff5c5c',
                          color: 'white',
                          border: 'none',
                          borderRadius: '5px',
                          cursor: 'pointer',
                          width: '100%',
                        }}
                      >
                        Logout
                      </button>
                    </div>
                  )}
                </>
              ) : null}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminNavBar;
